import React from 'react';

const Footer = () => {
  return (

<footer class="footer footer-static footer-light navbar-border navbar-shadow">
  <p class="clearfix blue-grey lighten-2 text-sm-center mb-0 px-2">
    <span class="float-md-left d-block d-md-inline-block">Copyright &copy; 2024 <a class="text-bold-800 grey darken-2" href="https://www.nascolebanon.com/"
      target="_blank">NASCO </a>, All rights reserved. </span>
    <span class="float-md-right d-block d-md-inline-blockd-none d-lg-block">Powered by Wissam AL HAJJ <i class="ft-heart pink"></i></span>
  </p>
</footer>

);
}

export default Footer;
